import { useEffect, useState } from "react";
import { useSelector } from "react-redux";
import { useDispatch } from "react-redux";
import { getUsers,getbydomain } from "../../actions/index";
import Student from "./card/card";
import { Button } from "bootstrap";
import Form from 'react-bootstrap/Form';
import { Grid, CircularProgress } from '@material-ui/core';
import { Link } from "react-router-dom";
function Card(){
    const [domain,setDomain]=useState("ALL")
    const dispatch=useDispatch()
   
    // console.log((Object.keys(users).length >0));
    console.log("useffect called");
   
   const users=[{   
"username":"ujjawal tyagi",
"email":"tyagiujjawal763@gmail.com",
"password":"123",
"domain":"IIT",
"gender":"male",
"about":"i've been preparing since 2 years but still i'm confused.."
   }]
    // domain==='ALL'?dispatch(getUsers()):dispatch(getbydomain(domain))
    return(
        <>
        <Form.Select aria-label="Default select example"
        onChange={(e)=>setDomain(e.target.value)}  >
    <h1> Choose Peoples with your interest</h1>
      <option key="ALL"  value="ALL">ALL</option>
      <option key="ALL"  value="UPSC">UPSC</option>
      <option key="ALL"  value="IIT">IIT</option>
      <option key="ALL"  value="NEET">NEET</option>
      <option key="ALL"  value="UPPCS">UPPCS</option>
      <option key="ALL"  value="NDA">NDA</option>
      <option value="CDS">CDS</option>
    </Form.Select>
        <Link to="/home">
        <button style={{marginTop:'5rem'}}>back to home</button>
        </Link>
          {
            (Object.keys(users).length >0) ?(
            <Grid  container alignItems="stretch" spacing={1} style={{marginLeft:'2rem'}}>
        {users.map((user) => (
          <Grid key={user.id} item xs={12} sm={6} md={3}>
          <Student user={user}/>
          </Grid>
        ))}
      </Grid>
         ):"no such student"
          }
        </>
    )
}

export default Card
